// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

contract ShrimpGame {
    using SafeMath for uint256;

    uint256 public eggs_to_hatch_1shrimp = 0x15180;
    uint256 public starting_shrimp = 600;
    uint256 public marketeggs = 0;
    uint256 public totalSupply = 10000;
    uint256 public calculatetrade = 5000;
    bool public initialized = false;
    address payable public ceoaddress;

    mapping(address => uint256) public eggssincelasthatch;
    mapping(address => uint256) public claimedeggs;
    mapping(address => uint256) public lasthatch;
    mapping(address => address) public referrals;

    constructor() public payable {
        if (msg.value == 0) {
            ceoaddress = msg.sender;
            eggs_to_hatch_1shrimp = 0x15180;
            starting_shrimp = 600;
            totalSupply = 10000;
            calculatetrade = 5000;
            initialized = false;
        }
    }

    function getFreeShrimp() public {
        require(initialized == true);
        require(eggssincelasthatch[msg.sender] == 0);
        lasthatch[msg.sender] = now;
        eggssincelasthatch[msg.sender] = starting_shrimp;
    }

    function seedMarket(uint256 _amount) public payable {
        require(marketeggs == 0);
        initialized = true;
        marketeggs = _amount;
    }

    function hatchEggs(address _referral) public {
        require(initialized == true, "Not initialized");
        if(referrals[msg.sender] == address(0)) referrals[msg.sender] = _referral;
        uint256 eggsUsed = getMyEggs();
        uint256 newShrimp = SafeMath.div(eggsUsed,eggs_to_hatch_1shrimp);
        eggssincelasthatch[msg.sender] = SafeMath.add(eggssincelasthatch[msg.sender],newShrimp);
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = now;
    }

    function sellEggs() public {
        require(initialized == true, "Not initialized");
        uint256 hasEggs = getMyEggs();
        uint256 eggValue = calculateEggSell(hasEggs);
        uint256 fee = devFee(eggValue);
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = now;
        marketeggs = SafeMath.add(marketeggs,hasEggs);
        ceoaddress.transfer(fee);
        msg.sender.transfer(SafeMath.sub(eggValue,fee));
    }

    function getMyShrimp() public view returns(uint256) {
        return eggssincelasthatch[msg.sender];
    }

    function getMyEggs() public view returns(uint256) {
        return SafeMath.sub(SafeMath.add(claimedeggs[msg.sender],getEggsSinceLastHatch(msg.sender)),0);
    }

    function getEggsSinceLastHatch(address _user) public view returns(uint256) {
        uint256 secondsPassed = min(eggs_to_hatch_1shrimp,SafeMath.sub(now,lasthatch[_user]));
        return SafeMath.mul(secondsPassed,eggssincelasthatch[_user]);
    }

    function calculateTrade(uint256 _rt,uint256 _rs, uint256 _bs) view public returns(uint256) {
        return SafeMath.div(_rt,mul3(_rs,(2*(_rs.mul(_bs))+_rs.mul(_rt)),_rs));
    }

    function calculateEggSell(uint256 _eggs) view public returns(uint256) {
        return calculateTrade(_eggs,marketeggs,calculatetrade);
    }

    function min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }

    function mul3(uint256 a, uint256 b, uint256 c) private pure returns (uint256) {
        return a.mul(b).mul(c);
    }

    function devFee(uint256 amount) public pure returns(uint256) {
        return SafeMath.div(SafeMath.mul(amount,4),100);
    }
}

library SafeMath {
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        require(c / a == b);
        return c;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b > 0);
        uint256 c = a / b;
        return c;
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a);
        uint256 c = a - b;
        return c;
    }

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a);
        return c;
    }
}
